import { useState, useEffect } from 'react';
useEffect(() => {
	document.title = 'ログアウト';
}, []);
function Logout() {
	useEffect(() => {
		document.title = 'ログアウト';
	}, []);
	return <div>ログアウトしました</div>;
}

export default Logout;
